import '../styles/User.css';
function User(){
    return(
    <div className='container'>
        <h1>Energy Management </h1>
        <label>User:</label>
        
        <input placeholder="ex: John123"></input>
        <label>Password:</label>
        <input placeholder="ex: PassworD!56"></input>
        <button type="submit">Login</button>
    </div>

    );
}

export default User;
